<!DOCTYPE html>
<html>
<head>
  <meta charset="utf-8">
  <title>Submit Form</title>
</head>
<body>
  <form id="form-datos">
    <hr>
    <label for="nombre">Nombre del Proyecto:</label>
    <input type="text" id="nombre" name="nombre"><br>
    <hr>
    <label for="version">Versión:</label>
    <input type="text" id="version" name="version"><br>
    <hr>
    <label for="ide">ID:</label>
    <input type="text" id="ide" name="id"><br>
    <hr>
    <label for="descripcion">Descripción del Proyecto <br> (puede ser tanto del proyecto <br> como tambien de una update del mismo):</label>
    <input type="text" id="descripcion" name="descripcion"><br>
    <hr>
    <label for="imagen">Imagen:</label>
    <input type="text" id="imagen" name="imagen"><br>
    <hr>
    <label for="url">URL del proyecto <br>(puede ser enlace de descarga, <br>server de discord o pagina web):</label>
    <input type="text" id="url" name="url"><br>
    <hr>
<button type="button" id="boton-enviar" onclick="enviarAlerta()">Enviar</button>
  </form>
  <script src="discord.js"></script>
